import React, {useState} from 'react';
import '../styles/modal.css';
import handleLogin from './functions/handleLogin.js'


//Tener las funciones en otro archivo me facilita el testing y la reutiizacion
function ModalLogin(props) {

  const[username,Setusername] = useState('');

  function handleChange(e) {
    Setusername(e.target.value);
  };




  return(
    <div className='cont'>
      <div className='modal'>
          <form className='modal-content' onSubmit={handleLogin} name='form'>
            <input type='text' placeholder='No te conozco... me decis quien sos?' onChange={handleChange}/>
          </form>
        </div>
    </div>

  );
};



export default ModalLogin;
